// https://leetcode-cn.com/problems/minimum-window-substring/
// 失败：速度不够快，搜索空间过大
#include <cstdio>
#include <string>
#include <vector>
#include <unordered_set>
#include <unordered_map>
using namespace std;

class Solution {
	void insert(unordered_map<int, int>& m, int start, int end) {
		for (auto it = m.begin(); it != m.end();) {
			int a = it->first;
			int b = it->second;
			if (start <= a && b <= end) return;
			if (a <= start && end <= b) {
				auto it2 = it++;
				m.erase(it2);
			} else {
				++it;
			}
		}
		m.insert(make_pair(start, end));
	}
public:
	string minWindow(string s, string t) {
		//printf("'%s', '%s'\n", s.c_str(), t.c_str());
		unordered_map<char, int> counter;
		unordered_map<char, vector<int>> index;
		for (int i = 0; i < t.size(); ++i) {
			char c = t[i];
			++counter[c];
			if (index.find(c) == index.end()) {
				index.insert(make_pair(c, vector<int>()));
			}
		}
		for (int i = 0; i < s.size(); ++i) {
			char c = s[i];
			if (index.find(c) != index.end()) {
				index[c].push_back(i);
			}
		}
		printf("index:"); for (auto it = index.begin(); it != index.end(); ++it) { printf(" [%c,%ld]", it->first, it->second.size()); }; printf("\n");
		if (index.empty()) return "";
		unordered_map<int, int> record; // [ start, end ]
		for (auto it = index.begin(); it != index.end(); ++it) {
			char c = it->first;
			int cc = counter[c] - 1;
			printf("process('%c', %d, record.size() = %d)\n", c, cc, record.size());
			if (cc >= it->second.size()) {
				return "";
			}
			if (it == index.begin()) {
				for (int i = cc; i < it->second.size(); ++i) {
					int a = it->second[i - cc];
					int b = it->second[i];
					insert(record, a, b);
				}
			} else {
				unordered_map<int, int> next;
				for (int i = cc; i < it->second.size(); ++i) {
					int left = it->second[i - cc];
					int right = it->second[i];
					for (auto it = record.begin(); it != record.end(); ++it) {
						int a = min(it->first, left);
						int b = max(it->second, right);
						insert(next, a, b);
					}
				}
				record = next;
			}
			//printf("[%c]:", c); for (auto e : record) { printf(" [%d,%d]", e.first, e.second); }; printf("\n");
		}
		if (record.empty()) return "";
		int min_size = 0;
		int a = -1;
		int b = -1;
		for (auto it = record.begin(); it != record.end(); ++it) {
			int size = it->second - it->first;
			if (min_size == 0 || size < min_size) {
				min_size = size;
				a = it->first;
				b = it->second;
			}
		}
		//printf("(%d,%d,%d)\n", min_size, a, b);
		return s.substr(a, b - a + 1);
	}
};

static const char* longString = "";
static const char* longQuery = "";
int main()
{
	Solution s;
	printf("%s\n", s.minWindow("ADOBECODEBANC", "ABC").c_str()); // answer: "BANC"
	printf("%s\n", s.minWindow("a", "aa").c_str()); // answer: "a"
	printf("%s\n", s.minWindow("aba", "aa").c_str()); // answer: "aba"
	printf("%s\n", s.minWindow("abaa", "aa").c_str()); // answer: "aa"
	printf("%s\n", s.minWindow("aaabaabab", "aab").c_str()); // answer: "aab"
	printf("%s\n", s.minWindow("cabefgecdaecf", "cae").c_str()); // answer: "ace"
	printf("%s\n", s.minWindow("b..a...cb....a.b", "abc").c_str()); // answer: "a...cb"
	printf("%s\n", s.minWindow("a", "b").c_str()); // answer: ""
	printf("%s\n", s.minWindow("a", "ab").c_str()); // answer: ""
	printf("%s\n", s.minWindow("ask_not_what_your_country_can_do_for_you_ask_what_you_can_do_for_your_country", "ask_country").c_str()); // answer: "sk_not_what_your_countr"
	printf("%s\n", s.minWindow("cabwefgewcwaefgcf", "cae").c_str()); // answer: "cwae"
	printf("%s\n", s.minWindow("", "").c_str()); // answer: ""
	printf("%s\n", s.minWindow("", "fjknwevk").c_str()); // answer: ""
	printf("%s\n", s.minWindow("abcabdebac", "cda").c_str()); // answer: "cabd"
	printf("%s\n", s.minWindow(longString, longQuery).c_str());
	return 0;
}
